import { useFetch } from "../hooks/useFetch";

const urlLanguages= `https://api.github.com/repos/GabrielNicodemos/${repository.name}/languages`;

const CardRepository = ({ repository }) => {
  const { data: languages } = useFetch(urlLanguages);

  return (
    <div className='card'>

      {/* Name, visibility, description, languages, created date, updated date, archived */}
      <span>{repository.visibility}</span>
      <h1>{repository.name}</h1>
      {repositories &&
        repositories.map((repository) => (
          <CardRepository repository={repository} />
        ))}



      {repository.id}</div>
  )
}

export default CardRepository
